import React from "react";
import { Link } from "react-router-dom";
import UseParams from "./useParams";
function Body() {
  return (
    <div className="bod">
      <canvas class="Gradient__canvas isLoaded" data-js-controller="Gradient" data-js-darken-top="" data-transition-in="" width="811" height="600"></canvas>
      <del className="mem">Memorize</del>
      <br />
      Save It!
      <br />
      <p className="mm">
        Use BookNotes to save your selected text etc,
        <br />
        so you dont have to remember anything.
      </p>
      <Link to="/create" className="btn btn-success">
        Create Note
      </Link>
    </div>
  );
}

export default Body;
